import React from 'react';

import NavSearch from '../navSection/NavSearch';

function Product() {
  return (
    <div>
      <NavSearch />
      <div>
        <div class>
          <img src={''} alt="" />
        </div>
      </div>
    </div>
  );
}

export default Product;
